import { BrowserRouter } from 'react-router-dom';
import './App.css';
import { AuthWrapper } from './auth/AuthWrapper';
import ScriptTag from 'react-script-tag';

function MyComponent() {
  return (
    <div>
      <ScriptTag src="src/components/pages/Faqdropdown.js" />
    </div>
  );
}


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <AuthWrapper />
      </BrowserRouter>      
    </div>
  );
}

export default App;
